import { LoginOutlined } from "@mui/icons-material";
import { Button, makeStyles, Stack, TextField } from "@mui/material";
import { Formik } from "formik";

// Create the struct of the formData
interface myFormData {
  email: string;
  password: string;
}


// Login method
const login = (formData: Object) => {
  console.log(formData);
};

const Login = () => {
  let initFormValues: myFormData = { email: "", password: "" };

  return (
    <Stack  alignItems={"center"} 
            justifyContent={"center"} mt={20}>

        <Formik
                initialValues={initFormValues}
                onSubmit={(values) => login(values)}>

            <Stack  sx={{ width: 500 }} 
                    spacing={2}>
                <TextField  name="email" 
                            label={"Email"} 
                            size={'small'} 
                            sx={{border : '0.5px solid lightblue'}} />
                <TextField name="password" label={"Password"} size={'small'} color={'primary'} />
                <Button variant="outlined" endIcon={<LoginOutlined />}>Login</Button>
            </Stack>

        </Formik>
    </Stack>
  );
};

export default Login;
